import React from "react";
import ProductCard from "./ProductCard";

function Products( { products } ) {

  function renderProducts() {
    return products.map((product)=> (
      <ProductCard 
        key={product.id} 
        product={product} 
      />
    ));
  }

  return (
    <div>
      <ul className="cards">{renderProducts()}</ul>
    </div>
  );

}


export default Products;
